import SearchBar from '../SearchBar/SearchBar'
import style from './NavBar.module.css'
import { Link, NavLink } from 'react-router-dom'

const NavBar = ({ onSearch, randomSearch }) => {
    return (
        <div className={style.nav}>
            <SearchBar onSearch={onSearch} randomSearch={randomSearch} />
            {/* <div className={style.buttons2}> */}
                <Link to='/home'>
                    <button className={style.buttonDet}>Home</button>
                </Link>
                <NavLink to='/about'>
                    <button className={style.buttonAb}>About</button>
                </NavLink>
            {/* </div> */}
        </div>
    )
};

export default NavBar
